⁠⠀
Morning coffee came with deer sightings and watching the sunrise peek over the nearby mountains. My dog had a great time swimming in the lagoon and pouncing on grasshoppers in the tall grass. ⁠⠀
⁠⠀
We even got a bit of rain one of the days which cooled things down enough to get a fire going in the fireplace. ⁠⠀
⁠⠀
All in all, a cozy time was had.⁠⠀
⁠⠀
While my body is physically back home now, my head still seems to be back there, which has inspired a new postcard design.⁠⠀
⁠⠀
I'll be releasing this one, and a couple of other new ones, soon - and as singles vs. in a set. ⁠⠀
⁠⠀
Hopefully that will allow you to snap up ONLY the ones you want or purchase multiples of the same design.⁠⠀
⁠⠀
