⠀⠀⠀⠀⠀⠀⠀⠀⠀
Hi beautiful! 💕⠀⠀⠀⠀⠀⠀⠀⠀⠀
⠀⠀⠀⠀⠀⠀⠀⠀⠀
I have a feeling...that you’ve has a bunch of feelings in reaction to this whole #stayathome #covid19 fiasco. ⠀⠀⠀⠀⠀⠀⠀⠀⠀
⠀⠀⠀⠀⠀⠀⠀⠀⠀
What feelings are they? Do you switch from one to the other? What are the downsides and what are the positive aspects for you?⠀⠀⠀⠀⠀⠀⠀⠀⠀
⠀⠀⠀⠀⠀⠀⠀⠀⠀
I am feeling grateful that I am healthy and so are my family. I am feeling disappointed and sad that my wee baby Ella is 3 months and hasn’t met any of her Scottish family from my side yet. If it wasn’t for this crazy time she would have met her Granny and Grandad Burke as from a day old. 😞 I am feeling inspired and creative and have so much I want to achieve. I take baby steps because I have a baby who doesn’t sleep all through the night and feeds every 2 hours...I am breastfeeding. 😂😂 ⠀⠀⠀⠀⠀⠀⠀⠀⠀
⠀⠀⠀⠀⠀⠀⠀⠀⠀
Whatever you’re feeling, acknowledge it and give yourself the permission to feel it. 🤗 Don’t judge it, just observe and feel it. Then based on that information, choose one small and positive action to carry out in that moment. E.g go for a walk, call a friend, listen to a favourite podcast, write, listen to music, stretch, play with your dog. Whatever you need, respect and honour it.⠀⠀⠀⠀⠀⠀⠀⠀⠀
⠀⠀⠀⠀⠀⠀⠀⠀⠀
Love and hugs, Kathryn. 💕⠀⠀⠀⠀⠀⠀⠀⠀⠀
